    <script type="text/javascript">
      const pyodideWorker = new Worker("./teste.js");
      pyodideWorker.busy = false
      pyodideWorker.queue = []
      
      function send_change(jsdoc, event) {
        if (event.setter_id != null && event.setter_id == 'py') {
          return
        } else if (pyodideWorker.busy && event.model && event.attr) {
          let events = []
          for (const old_event of pyodideWorker.queue) {
            if (!(old_event.model === event.model && old_event.attr === event.attr)) {
              events.push(old_event)
            }
          }
          events.push(event)
          pyodideWorker.queue = events
          return
        }
        const patch = jsdoc.create_json_patch([event])
        pyodideWorker.busy = true
        pyodideWorker.postMessage({type: 'patch', patch: patch})
      }
      
      pyodideWorker.onmessage = async (event) => {
        const msg = event.data
      
        const body = document.getElementsByTagName('body')[0]
        const loading_msgs = document.getElementsByClassName('pn-loading-msg')
        if (msg.type === 'idle') {
          if (pyodideWorker.queue.length) {
            const patch = pyodideWorker.jsdoc.create_json_patch(pyodideWorker.queue)
            pyodideWorker.busy = true
            pyodideWorker.queue = []
            pyodideWorker.postMessage({type: 'patch', patch: patch})
          } else {
            pyodideWorker.busy = false
          }
        } else if (msg.type === 'status') {
          let loading_msg
          if (loading_msgs.length) {
            loading_msg = loading_msgs[0]
          } else if (body.classList.contains('pn-loading')) {
            loading_msg = document.createElement('div')
            loading_msg.classList.add('pn-loading-msg')
            body.appendChild(loading_msg)
          }
          if (loading_msg != null) {
            loading_msg.innerHTML = msg.msg
          }
        } else if (msg.type === 'render') {
          const docs_json = JSON.parse(msg.docs_json)
          const render_items = JSON.parse(msg.render_items)
          const root_ids = JSON.parse(msg.root_ids)
      
          // Remap roots in message to element IDs
          const root_els = document.querySelectorAll('[data-root-id]')
          const data_roots = []
          for (const el of root_els) {
             el.innerHTML = ''
             data_roots.push([el.getAttribute('data-root-id'), el.id])
          }
          data_roots.sort((a, b) => a[0]<b[0] ? -1: 1)
          const roots = {}
          for (let i=0; i<data_roots.length; i++) {
            roots[root_ids[i]] = data_roots[i][1]
          }
          render_items[0]['roots'] = roots
          render_items[0]['root_ids'] = root_ids
      
          // Embed content
          const [views] = await Bokeh.embed.embed_items(docs_json, render_items)
      
          // Remove loading spinner and message
          body.classList.remove("pn-loading", "arc")
          for (const loading_msg of loading_msgs) {
            loading_msg.remove()
          }
      
          // Setup bi-directional syncing
          pyodideWorker.jsdoc = jsdoc = [...views.roots.values()][0].model.document
          jsdoc.on_change(send_change.bind(null, jsdoc), false)
          pyodideWorker.postMessage({'type': 'rendered'})
          pyodideWorker.postMessage({'type': 'location', location: JSON.stringify(window.location)})
        } else if (msg.type === 'patch') {
          pyodideWorker.jsdoc.apply_json_patch(msg.patch, msg.buffers, setter_id='py')
        }
      };
    </script>

,{"id":"p1035"}]]},"code":"\n        const cb = function() {\n\n          function get_padded_range(key, lowerlim, upperlim, invert) {\n            let vmin = range_limits[key][0]\n            let vmax = range_limits[key][1]\n\n            if (lowerlim !== null) {\n             vmin = lowerlim\n            }\n\n            if (upperlim !== null) {\n             vmax = upperlim\n            }\n\n            const span = vmax-vmin\n            const lower = vmin-(span*0)\n            const upper = vmax+(span*0)\n            return invert ? [upper, lower] : [lower, upper]\n          }\n\n          const ref = plot.id\n\n          const find = (view) =&gt; {\n            let iterable = view.child_views === undefined ? []  : view.child_views\n            for (const sv of iterable) {\n              if (sv.model.id == ref)\n                return sv\n              const obj = find(sv)\n              if (obj !== null)\n                return obj\n            }\n            return null\n          }\n          let plot_view = null;\n          for (const root of plot.document.roots()) {\n            const root_view = window.Bokeh.index[root.id]\n            if (root_view === undefined)\n              return\n            plot_view = find(root_view)\n            if (plot_view != null)\n              break\n          }\n          if (plot_view == null)\n            return\n\n          let range_limits = {}\n          for (const dr of plot.data_renderers) {\n            const renderer = plot_view.renderer_view(dr)\n            const glyph_view = renderer.glyph_view\n\n            let [vmin, vmax] = [Infinity, -Infinity]\n            let y_range_name = renderer.model.y_range_name\n\n            if (!renderer.glyph.model.tags.includes('no_apply_ranges')) {\n              const index = glyph_view.index.index\n              for (let pos = 0; pos &lt; index._boxes.length - 4; pos += 4) {\n                const [x0, y0, x1, y1] = index._boxes.slice(pos, pos+4)\n                if (y0 &gt; plot.y_range.start &amp;&amp; y1 &lt; plot.y_range.end) {\n                  vmin = Math.min(vmin, x0)\n                  vmax = Math.max(vmax, x1)\n                }\n              }\n            }\n\n            if (y_range_name) {\n              range_limits[y_range_name] = [vmin, vmax]\n            }\n          }\n\n           let range_tags_extras = plot.x_range.tags[1]\n           if (range_tags_extras['autorange']) {\n             let lowerlim = range_tags_extras['y-lowerlim'] ?? null\n             let upperlim = range_tags_extras['y-upperlim'] ?? null\n             let [start, end] = get_padded_range('default', lowerlim, upperlim, range_tags_extras['invert_yaxis'])\n             if ((start != end) &amp;&amp; window.Number.isFinite(start) &amp;&amp; window.Number.isFinite(end)) {\n               plot.x_range.setv({start, end})\n             }\n           }\n\n          for (let key in plot.extra_x_ranges) {\n            const extra_range = plot.extra_x_ranges[key]\n            let range_tags_extras = extra_range.tags[1]\n\n            let lowerlim = range_tags_extras['y-lowerlim'] ?? null\n            let upperlim = range_tags_extras['y-upperlim'] ?? null\n\n            if (range_tags_extras['autorange']) {\n             let [start, end] = get_padded_range(key, lowerlim, upperlim, range_tags_extras['invert_yaxis'])\n             if ((start != end) &amp;&amp; window.Number.isFinite(start) &amp;&amp; window.Number.isFinite(end)) {\n              extra_range.setv({start, end})\n              }\n            }\n          }\n        }\n        // The plot changes will not propagate to the glyph until\n        // after the data change event has occurred.\n        setTimeout(cb, 0);\n        "}}]]]},"width":700,"height":300,"sizing_mode":"fixed","align":"start","x_range":{"type":"object","name":"Range1d","id":"p1020","attributes":{"tags":[[["date","date",null]],[]],"start":1671374057142.8572,"end":1700688342857.1428,"reset_start":1671374057142.8572,"reset_end":170  ?? null\n             let [start, end] = get_padded_range('default', lowerlim, upperlim, range_tags_extras['invert_yaxis'])\n             if ((start != end) &amp;&amp; window.Number.isFinite(start) &amp;&amp; window.Number.isFinite(end)) {\n               plot.x_range.setv({start, end})\n             }\n           }\n\n          for (let key in plot.extra_x_ranges) {\n            const extra_range = plot.extra_x_ranges[key]\n            let range_tags_extras = extra_range.tags[1]\n\n            let lowerlim = range_tags_extras['y-lowerlim'] ?? null\n            let upperlim = range_tags_extras['y-upperlim'] ?? null\n\n            if (range_tags_extras['autorange']) {\n             let [start, end] = get_padded_range(key, lowerlim, upperlim, range_tags_extras['invert_yaxis'])\n             if ((start != end) &amp;&amp; window.Number.isFinite(start) &amp;&amp; window.Number.isFinite(end)) {\n              extra_range.setv({start, end})\n              }\n            }\n          }\n        }\n        // The plot changes will not propagate to the glyph until\n        // after the data change event has occurred.\n        setTimeout(cb, 0);\n        "}}]]]},"width":700,"height":300,"sizing_mode":"fixed","align":"start","x_range":{"id":"p1020"},"y_range":{"id":"p1021"},"x_scale":{"type":"object","name":"LinearScale","id":"p1327"},"y_scale":{"type":"object","name":"LinearScale","id":"p1328"},"title":{"type":"object","name":"Title","id":"p1320","attributes":{"text":"18 UTC","text_font":"Roboto, sans-serif, Verdana","text_font_size":"1.15em"}},"renderers":[{"type":"object","name":"BoxAnnotation","id":"p1363","attributes":{"level":"glyph","left":{"type":"object","name":"Node","id":"p1370","attributes":{"target":"frame","symbol":"left"}},"right":{"type":"object","name":"Node","id":"p1371","attributes":{"target":"frame","symbol":"right"}},"top":98.53999999999999,"bottom":98.56,"line_color":"lightgray","line_alpha":0.5,"fill_color":"lightgray","fill_alpha":0.5}},{"type":"object"
